    const navigate = useNavigate();

    const onButtonClicked = () =>{
        navigate('/AllRestaurants');
    };
  return (
    <div>
       <button onClick={onButtonClicked}> <TitlePP>All Restaurants &gt;&gt;</TitlePP> </button>
    </div>
  )
}
